export default ({ img, title }) => {
  return (
    <div className='md:w-30/31'>
      <div className='mr-4 xl:flex xl:flex-wrap xl:items-center xl:justify-start xl:shadow-md xl:rounded-xl bg-white'>
        <img
          src={img}
          className='h-64 w-auto rounded-xl rounded-r-none'
          style={{ width: 'auto' }}
          alt='explore1'
        />
        <p class='pl-4 text-gray-750 font-semibold'>{title}</p>
      </div>
    </div>
  );
};
